import { AxiosInstance } from "../../Network/AxiosInstance"

export const addMovies = () => (dispatch, page)=>{
   return AxiosInstance.get(`/movie/popular?api_key=addc24fa3de68655222e36f0796cadb2&page=${page}`)
    .then((res) => {
        dispatch({
            type: "GET_MOVIES",
            payload: res.data.results
        })
    })
    .catch((err) => console.log(err))
}
